import React from 'react';
import { Link } from 'react-router-dom'


function Github(props) {
    return(
        <div>
            <br /><br /><br /><br />
                <center>
                    <h1> Github </h1>
                    <Link id='link' to={`https://github.com/ShobithChandran`} style={{paddingLeft: 13, textDecoration: 'none'}} >
                        <h3>Click here</h3>
                    </Link>
                    <br /><br /><br /><br />
                </center>
            </div>
    );   
}

export default Github;
